    background-image: url(https://img.zohocdn.com/projects/images/png/summary-tiles/summary-bugs_d06c0_.png);
    background-size: 300px 100px;
    border-radius: 8px;
    border: 1.5px solid rgb(257,213,242);
    border-bottom: 6px solid rgb(255,233,233);
    background-size: 300px 100px;
    }

    .close-card .icon-class {
    font-size: 20px;
    align-items: center;
    display: flex;
    margin: 5px;
}
    .close-issue:hover {
        box-shadow: rgba(99, 99, 99, 0.2) 0px 2px 8px 0px;
    }
    .close-issue {
        background: #a3a0ff;
        border: none;
    }

    .close-issue .icon-class {
    font-size: 20px;
    align-items: center;
    display: flex;
    margin: 5px;
}

  .main-card {
    border: none;
    background-size: 800px;
    background: white !important;
    background-repeat: repeat;
}

