":null,"eq":"","json":""},"customConditional":"","logic":[],"attributes":{},"overlay":{"style":"","page":"","left":"","top":"","width":"","height":""},"Permission":{"componentValue":{}},"Configuration":{"componentValue":{"dataSourceQueryId":"28318c01-62fb-4891-933f-efaed9ecc3e2","templateMode":"customHtml","isAllowCustomView":false,"noOfRecord":10,"customHtml":{"componentValue":"<style>
    .user-card {
        position: relative;
        padding: 7px;
        width: 100%;
        margin: 0 0 0 0;
        font-size: 13px !important;
        border: 1px solid rgba(0, 0, 0, .125) !important;
    }

    .user-card .user-card-header {
        display: flex;
        align-items: center;
    }

    .user-card .user-info {
        width: 100%;
    }

    .user-card .user-data {
        display: flex;

        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
    }

    .user-card .user-name {
        font-size: 14px;
        font-weight: 600;
        color: #1967be;
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
    }

    .user-card .active-badge {
        padding: 2px 8px;
        background: #bbf7d0;
        border-radius: 8px;
        font-size: 12px;
        font-weight: bold;
        color: #166534;
        margin-left: auto;
    }

    .user-card .deactive-badge {
        padding: 2px 8px;
        background: #fecaca;
        border-radius: 8px;
        font-size: 12px;
        font-weight: bold;
        color: #991b1b;
        margin-left: auto;
    }

    .user-card .user-card-email {
        margin: 6px 0;
    }

    .user-card .icon-box i {
        font-size: 16px;
        margin-right: 6px;
        color: #1967be;
    }

    .user-basic-info {
        display: flex;
        align-items: baseline;
    }

    .user-basic-info-box {
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
        padding-right: 8px;
        margin-right: 8px;
    }

    .user-basic-info-box span {
        margin-right: 4px;
    }

    .user-basic-info-box i {
        margin-right: 4px;
    }

    .user-basic-info-box .e-people i {
        font-size: 15px;
    }

    .user-card .edit-btn {
        margin-left: auto;
        width: 26px;
        height: 26px;
        cursor: pointer;
        background-color: #f3f3f3;
        border: 1px solid rgba(0, 0, 0, .125) !important;
    }

    .user-card .edit-btn i {
        margin: 5px;
        font-size: 16px;
        color: #1967be;
    }
</style>
<div class="user-card">
    <div class="user-card-header">

        <div class="user-info">
            <div class="user-data">

                <span class="user-name">${ResourceName}</span>

            ${if(IsEnabled == true)}
                <span class="active-badge">Active</span>
          ${else}
        <span class="deactive-badge">InActive</span>
          ${/if}
          
            </div>
            <div class="user-basic-info-box"><span class="icon-box"><i class="fa fa-envelope-o"></i></span>${Email}
            </div>
            <div class="user-basic-info-box"><span><b>Role :</b></span>${RoleName}</div>
        </div>
    </div>
</div>"}}},"type":"listview","dataGridLabel":false,"input":true,"refreshOn":"","addons":[],"id":"e6g10w","defaultValue":""}],"width":3,"offset":0,"push":0,"pull":0,"size":"md","currentWidth":3},{"components":[{"label":"HTML","tag":"div","className":"","attrs":[{"attr":"","value":""}],"content":"
  
