  <style>
    
    .employee-list {
      max-width: 800px;
      margin: 0 auto;
    }
    
    .employee-card {
      padding: 10px;
      border-bottom: 1px solid #e0e0e0;
    }
    
    .employee-header {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 4px;
    }
    
    .employee-name {
      font-size: 14px;
      font-weight: 600;
      color:var(--primary-color);
    }
    
    .status-badge {
      padding: 2px 8px;
      border-radius: 4px;
      font-size: 12px;
      font-weight: 500;
    }
    
    .status-badge.Inactive {
      background-color: #ffebee;
      color: #d32f2f; 
    }
    
    .status-badge.Active {
      background-color: #e8f5e9;
      color: #2e7d32;
    }
    
    .employee-info {
      display: flex;
      flex-direction: column;
      gap: 2px;
      margin-bottom: 4px;
    }
    
    .info-row {
      display: flex;
      align-items: center;
      gap: 8px;
    }
    
    .info-row .icon {
      color: #757575;
      width: 13px;
    }
    
    .info-row .value {
      color: #555;
      flex: 1;
      font-size: 14px;
      overflow: hidden;
      white-space: nowrap;
      text-overflow: ellipsis;
    }
    
    .department {
      text-align: right;
      color: #555;
      font-size: 14px;
    }
    
    .rates {
      display: flex;
      justify-content: space-between;
      align-items: center;
      margin-bottom: 12px;
    }
    
    .rate-value {
      color: #555;
      font-weight: 500;
    }
    
    .margin {
      color: #555;
    }
    
    .projects-section {
      display: flex;
      align-items: center;
      gap: 8px;
    }
    
    .projects-label {
      color: #757575;
      font-size: 14px;
    }
    
    .project-tag {
      background-color: #f5f5f5;
      color: #1976d2;
      padding: 3px 8px;
      border-radius: 4px;
      font-size: 13px;
    }
    
    @media (max-width: 600px) {
      .employee-header, .rates {
        flex-direction: column;
        align-items: flex-start;
        gap: 4px;
      }
      
      .status-badge {
        align-self: flex-start;
        margin-top: 4px;
      }
      
      .department, .margin {
        text-align: left;
        margin-top: 4px;
      }
      
      .projects-section {
        flex-wrap: wrap;
      }
    }
  </style>"}}},"EventActionConfiguration":{"componentValue":{"componentBasedEventsPreview":{"componentValue":{}},"userDefinedEventsPreview":{"componentValue":{}}}},"type":"listview","dataGridLabel":false,"input":true,"refreshOn":"","addons":[],"id":"einm8d"}],"width":3,"offset":0,"push":0,"pull":0,"size":"md","currentWidth":3},{"components":[{"label":"HTML","tag":"div","attrs":[{"attr":"","value":""}],"content":"
  
